We can create entities in the registry using the Create Entity API Endpoint . To create a Teacher entity named Pranav Agate who teaches Math at UP Public School, we would make the following API call: cURL curl --location \ --request 'POST' \ --header 'content-type: application/json' \ --data-raw '{ "name": "Pranav Agate", "phoneNumber": "1234567890", "email": "pranav@upps.in", "subject": "Math", "school": "UP Public School" }' \ 'http://localhost:8081/api/v1/Teacher/invite' HTTPie echo '{ "name": "Pranav Agate", "phoneNumber": "1234567890", "email": "pranav@upps.in", "subject": "Math", "school": "UP Public School"
}' | http post \ 'http://localhost:8081/api/v1/Teacher/invite' \ 'content-type: application/json' This will store the entity in the registry and return the following object: { "id": "open-saber.registry.invite", "ver": "1.0", "ets": 1634198998956, "params": { "resmsgid": "", "msgid": "3ee6a76f-d6c8-4262-a7ee-ddbe66fcb127", "err": "", "status": "SUCCESSFUL", "errmsg": "" }, "responseCode": "OK", "result": { "Teacher": { "osid": "1-9d6099fc-2c01-4714-bceb-55ff28c482f9" } }
} Important variables in the response body: Field In Type Description result.{entity-type}.osid body string The ID of the create entity in the registry, used for retrieval and modification of the entity

17.body:
We can update entities in the registry using the Update Entity API Endpoint . So to update the subject our Teacher entity Pranav Agate teaches to Biology, we would make the following API call: cURL curl --location \ --request 'PUT' \ --header 'content-type: application/json' \ --header 'authorization: bearer {access-token}' \ --data-raw '{ "name": "Pranav Agate", "phoneNumber": "1234567890", "email": "pranav@upps.in", "subject": "Biology", "school": "UP Public School" }' \ 'http://localhost:8081/api/v1/Teacher/{id}' HTTPie echo '{ "name": "Pranav Agate", "phoneNumber": "1234567890", "email": "pranav@upps.in", "subject": "Biology", "school": "UP Public School"
}' | http put \ 'http://localhost:8081/api/v1/Teacher/{id}' \ 'content-type: application/json' \ 'authorization: bearer {access-token}' Replace the {id} above with the entity's osid you saved from the create entity request. Replace the {access-token} with the Teacher entity's access token from the authentication step. We need to send the whole entity and not just the updated fields because that is how RESTful APIs work. A PUT call should replace the existing record in the database with the new object as-is. To know more about this, take a look at the accepted answer on this SO question . This will update the entity in the registry and return the following object: { "id": "open-saber.registry.update", "ver": "1.0", "ets": 1634371946769, "params": { "resmsgid": "", "msgid": "d51e6e6a-027d-4a42-84bb-2ce00e31d993", "err": "", "status": "SUCCESSFUL", "errmsg": "" }, "responseCode": "OK"
}

18.body:
To make a claim, we can use the Claim API Endpoint . First, let us create a Student entity named Prashant Joshi who also goes to UP Public School: cURL curl --location \ --request 'POST' \ --header 'content-type: application/json' \ --data-raw '{ "name": "Prashant Joshi", "phoneNumber": "9876543210", "email": "prashant@upps.in", "school": "UP Public School" }' \ 'http://localhost:8081/api/v1/Student/invite' HTTPie echo '{ "name": "Prashant Joshi", "phoneNumber": "9876543210", "email": "prashant@upps.in", "school": "UP Public School"
}' | http post \ 'http://localhost:8081/api/v1/Student/invite' \ 'content-type: application/json' Next, we can get an access token for Prashant by making a POST request to the authentication server. See the Authenticating As An Entity section to know how to do that. Then, we can send the claim (that Prashant is a student at UP Public School) for attestation by making the following request: curl --location \ --request 'PUT' \ --header 'content-type: application/json' \ --header 'authorization: bearer {access-token}' \ --data-raw '"UP Public School"' \ 'http://localhost:8081/api/v1/Student/{id}/school?send=true' HTTPie echo '"UP Public School"' | http put \ 'http://localhost:8081/api/v1/Student/{id}/school' \ 'content-type: application/json' \ 'authorization: bearer {access-token}' \ 'send==true' Replace the {id} above with the entity's osid you saved from the create entity request. Replace the {access-token} with the Student entity's access token from the authentication step. This will send the claim for attestation and return the following object: { "id": "open-saber.registry.update", "ver": "1.0", "ets": 1634371946769, "params": { "resmsgid": "", "msgid": "ksi38Dsl-8dIw-492j-6vlS-84KRe0Csop35", "err": "", "status": "SUCCESSFUL", "errmsg": "" }, "responseCode": "OK"
} If you retrieve the Student entity by following the Retrieving An Entity section , you will get the following object in response: { "email": "prashant@upps.in", "name": "Prashant Joshi", "phoneNumber": "9876543210", "school": "UP Public School", "osid": "{id}", "osOwner": ["{owner-id}"], "_osClaimId/school": "{claim-id}", "_osState/school": "ATTESTATION_REQUESTED"
} Important variables in the response body: Field In Type Description osOwner body string User ID of the entity in Keycloak. _osState/{field} body string State of an attestable field. Can be DRAFT (when it has not been sent for attestation), ATTESTATION_REQUESTED (when sent for attestation), PUBLISHED (when successfully attested) and REJECTED (when rejected by the attestor) _osClaimId/{field} body string ID of the claim made on a field, required when attesting the claim.

